materials.vertexShader:
//header-begin
uniform float iTime;
uniform vec2 iResolution;
uniform sampler2D iDepthTexture;
uniform sampler2D iSceneTexture;
uniform float iCameraNear;
uniform float iCameraFar;
uniform sampler2D iTexture0;
uniform sampler2D iTexture1;
//header-end
varying vec3 fNormal;
varying vec3 fPosition;
varying vec3 fObjPos;
varying vec2 fUV;
varying vec3 fView;
varying vec4 fProjPos;
varying float fDepth;

vec4 ComputeScreenPos(vec4 pos) {
    vec4 o = pos * 0.5;
    o.xy = vec2(o.x, o.y) + o.w;
    o.zw = pos.zw;
    return o;
}

mat2 scale(vec2 _scale){
    return mat2(_scale.x,0.0,
                0.0,_scale.y);
}

void main()
{
    fNormal = normalize(normal);
    fObjPos = position;
    vec4 wpos = modelMatrix * vec4(position, 1.0);
    fPosition = wpos.xyz;
    fUV = uv;
    fView = fPosition - cameraPosition;
    vec4 clipPos = projectionMatrix * modelViewMatrix * vec4( position, 1.0 );
    fProjPos = ComputeScreenPos(clipPos);
    //camera space object depth
    fDepth = -(modelViewMatrix * vec4(position, 1.0)).z * (1.0/iCameraFar);
    gl_Position = clipPos;
}

materials.fragmentShader:
//header-begin
uniform float iTime;
uniform vec2 iResolution;
uniform sampler2D iDepthTexture;
uniform sampler2D iSceneTexture;
uniform float iCameraNear;
uniform float iCameraFar;
uniform sampler2D iTexture0;
uniform sampler2D iTexture1;
//header-end
varying vec3 fNormal;
varying vec3 fPosition;
varying vec2 fUV;
varying vec3 fView;
varying vec4 fProjPos;
varying float fDepth;
varying vec3 fObjPos;

vec4 color = vec4(0.004,0.494,0.660,0.500);

float triWave(float t, float offset, float yOffset)
{
    return clamp(abs(fract(offset + t) * 2.0 - 1.0) + yOffset,0.0,1.0);
}

vec4 texColor(float rim)
{
	vec2 st = fUV;
    st *= 5.0;      // Scale up the space by 3
    st = fract(st); // Wrap arround 1.0

    vec4 mainTex = texture2D(iTexture0, st);
    mainTex.r *= triWave(iTime *0.848, abs(fObjPos.y) * 2.0, -0.340) * 6.0;
    //saturate the rim calculation because negative values caused weird artifacts
    mainTex.g *= clamp(rim,0.0,1.0) * (sin(iTime*2.0 + mainTex.b * 5.0) + 1.0);
    return mainTex.r * color + mainTex.g * color;
}


float perspectiveDepthToViewZ( const in float invClipZ, const in float near, const in float far ) {
    return ( near * far ) / ( ( far - near ) * invClipZ - far );
}

float viewZToOrthographicDepth( const in float viewZ, const in float near, const in float far ) {
    return ( viewZ + near ) / ( near - far );
}

float readDepth (sampler2D depthSampler, vec2 coord) {
    float fragCoordZ = texture2D(depthSampler, coord).x;
    float viewZ = perspectiveDepthToViewZ( fragCoordZ, iCameraNear, iCameraFar );
    return viewZToOrthographicDepth( viewZ, iCameraNear, iCameraFar );
}



void main()
{
    float screenDepth = readDepth(iDepthTexture,fProjPos.xy/fProjPos.w);
    //screenDepth *= iCameraFar;
	float diff = screenDepth - fDepth;
	float intersect = 0.0;
    if (diff > 0.0){
        intersect = 1.0 - smoothstep(0.0, (1.0/iCameraFar) * 0.5, diff);
    }

    float rim = 1.0 - abs(dot(fNormal, normalize(fView))) * 2.0;
	float northPole = (fObjPos.y - 0.930) * 17.320;
	float glow = max(max(intersect, rim), northPole);
    vec4 glowColor = vec4(mix(color.rgb, vec3(1.0,1.0,1.0), pow(glow, 4.0)), 1);
	vec4 hexes = texColor(rim);
    vec4 col = color * color.a + glowColor * glow + hexes;
    gl_FragColor = col;
}

